import React,{Component} from 'react'

class Final extends Component{

  winningTicket(){
    const winningTicket = this.props.tickets.slice();
  }

  render(){

    return (
          <>
          <h1>Край на лотарията</h1>
          <br/>
          {this.winningTicket}
          </>
      );

  }
  
}

export default Final;
